import React, { useState } from "react";

function Contact() {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    subject: "",
    message: ""
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Form submitted:", formData);
    alert("Thank you for reaching out! We will get back to you soon.");
    setFormData({ name: "", email: "", subject: "", message: "" });
  };

  return (
    <div id = "contacts" className="contact-page">
      <div className="contact-container">
        <div className="contact-form">
          <h2>Contact Me</h2>
          <p>For legal inquiries, consultations, or appointments, please reach out using the form below.</p>

          <form onSubmit={handleSubmit}>
            <label>Full Name:</label>
            <input
              type="text"
              name="name"
              value={formData.name}
              onChange={handleChange}
              required
            />

            <label>Email:</label>
            <input
              type="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              required
            />

            <label>Subject:</label>
            <input
              type="text"
              name="subject"
              value={formData.subject}
              onChange={handleChange}
            />

            <label>Message:</label>
            <textarea
              name="message"
              rows="5"
              value={formData.message}
              onChange={handleChange}
              required
            ></textarea>

            <button type="submit">Send Message</button>
          </form>
        </div>

        <div className="office-info">
          <h3>Office Information</h3>
          <p><strong>Law Office of Fekadu Hailemariam</strong></p>
          <p>Email: fekadu.lawoffice@example.com</p>
          <p>Phone: +251-911-234-567</p>
          <p>Address: Addis Ababa, Ethiopia</p>
        </div>
      </div>
    </div>
  );
}

export default Contact;
